**Bootstrap Navbar Tanpa jQuery**

Aku sangat jarang memakai javascript untuk animasi, namun aku perlu javascript untuk navbar. Karena itu di twbs-v4 aku membuang `bootstrap.js`, lalu membuat script sendiri secara native. 


```// https://mpetroff.net/2015/03/bootstrap-navbar-without-jquery/

document.addEventListener("DOMContentLoaded", function(event) { 
  // Check for click events on the navbar burger icon
  var toggler = document.getElementsByClassName('navbar-toggler')[0];
  var collapse = document.getElementById('navbarCollapse');
  var dropdownButton = document.getElementById('navbarDropdown');
  var dropdownMenu   = document.querySelector('[aria-labelledby="navbarDropdown"]');

  // Toggle if navbar menu is open or closed
  function toggleMenu() {
    collapse.classList.toggle('show');
    console.log('Toggle show class in navbar burger menu.');
  }

  function toggleDropdown() {
    dropdownMenu.classList.toggle('show');
    console.log('Toggle show class in dropdown burger menu.');
  }

  // Close dropdowns when screen becomes big enough to switch to open by hover
  function closeMenusOnResize() {    
    if (collapse.classList.contains('show')) {
        console.log('Resize window client before collapsing.');
        dropdownMenu.classList.remove('show');
    }
  }

  // Event listeners
  window.addEventListener('resize', closeMenusOnResize, false);
  toggler.addEventListener('click', toggleMenu, false);
  dropdownButton.addEventListener('click', toggleDropdown, false);
});```

Sependek ini lancar jaya, namun aku masih gagal menampilkan transisi-nya biar cakep seperti di `bootstrap.js` yang aseli.

**Bootstrap Navbar Dengan VueJS**

Dengan cara yang sama dengan `native` di atas, kita dapat melakukan juga melakukan `Vue`, sebagaimana berikut:

```document.addEventListener("DOMContentLoaded", function(event) { 
  console.log('Document is Ready.');

  new Vue({
    el: '#navbar-vue-app',
    data: {
      isOpenMenu: false,
      isOpenSubmenu: false
    },
    methods: {
      toggleOpenMenu: function (event) {
        this.isOpenMenu = !this.isOpenMenu;
        console.log('Toggle show class in navbar burger menu.');
      },
      toggleOpenSubmenu: function (event) {
        this.isOpenSubmenu = !this.isOpenSubmenu;
        console.log('Toggle show class in dropdown submenu.');
      },
      onResize(event) {
        if (this.isOpenSubmenu) {
          console.log('Remove show class before collapsing.');
          this.isOpenSubmenu = false;
        }
      }
    },
    mounted() {
      // Register an event listener when the Vue component is ready
      window.addEventListener('resize', this.onResize)
    },
    beforeDestroy() {
      // Unregister the event listener before destroying this Vue instance
      window.removeEventListener('resize', this.onResize)
    }
  });

});```

